import React, {useState, useEffect} from 'react';
import clsx from 'clsx';
import {makeStyles} from '@material-ui/core/styles';
import { Typography } from "@material-ui/core"
// import uuid from "uuid";
// import dynamic from 'next/dynamic'
// const uuid=dynamic(import ('uuid'),{ssr:false})


const useStyles = makeStyles(theme => ({
    root: {},
    posts: {
        marginTop: theme.spacing(2)
    },
    post: {
        marginBottom: theme.spacing(2)
    }
}));


interface InfoProps {
    className ?: string
    user: User
}

interface User {
    address: String
    avatar: String
    birthday: String
    email: String
    facebook: String
    first_name: String
    gender: String
    google_id: String
    id: String
    intro: String
    last_name: String
    phone: String
    mobile: String
    skype: String
    username: String
    viber: String
    website: String
    zalo: String
    created_at: String
    updated_at: String
}

const Info: React.FunctionComponent<InfoProps> = (props: InfoProps) => {
    const { className, ...rest } = props
    const classes = useStyles()
    console.log("props", props)
    return (
        <div {...rest} className={clsx(classes.root, className)}>
            {/* <Typography>
                {props.user.address}
            </Typography> */}
            <Typography>
                {props.user.birthday}
            </Typography>
            <Typography>
                {props.user.email}
            </Typography>
            <Typography>
                {props.user.first_name} {props.user.last_name}
            </Typography>
            <Typography>
                {props.user.gender}
            </Typography>
            <Typography>
                {props.user.intro}
            </Typography>
            <Typography>
                {props.user.phone}
            </Typography>
            <Typography>
                {props.user.mobile}
            </Typography>
            <Typography>
                {props.user.skype}
            </Typography>
            <Typography>
                {props.user.viber}
            </Typography>
            <Typography>
                {props.user.created_at}
            </Typography>
            <Typography>
                {props.user.updated_at}
            </Typography>
            <Typography>
                {props.user.zalo}
            </Typography>

        </div>
    );
};


export default Info;
